import Card from './Card';

export default function Collection(props) {
  const cards = ['Grookey', 'Thwackey', 'Rillaboom'];
  return(
    <div className="collection grid">
      {props.collection}
      {cards.map((item, index) => (
        <div className="grid-item">
          <Card item={item} key={index} />
        </div>
      ))}
    </div>
  )
}
